PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE m_live(
  live_id INTEGER NOT NULL,
  is_2d_live INTEGER NOT NULL,
  music_id INTEGER NOT NULL,
  bgm_path TEXT NOT NULL,
  chorus_bgm_path TEXT NOT NULL,
  live_member_mapping_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  pronunciation TEXT,
  member_group INTEGER NOT NULL,
  member_unit INTEGER,
  original_deck_name TEXT,
  copyright TEXT NOT NULL,
  source TEXT,
  jacket_asset_path TEXT NOT NULL,
  background_asset_path TEXT NOT NULL,
  display_order INTEGER NOT NULL,
  PRIMARY KEY (live_id),
  UNIQUE (display_order)
);
COMMIT;
